import React from 'react'
import PropTypes from 'prop-types'

const LoginInput = (props) => {
    return (
        <div>
        <input type='text' placeholder={props.placeholder}/>
        </div>
    )
}

LoginInput.defaultProps = {
    text: PropTypes.string,
}

export default LoginInput
